import React from 'react'
// import { useState } from 'react'
import { navLinks } from '../constants';


function classNames(...classes) {
  return classes.filter(Boolean).join(' ')
}
const Navbar = () => {
  return (
    <nav className='w-full flex py-6 justify-between items-left navbar text-white font-kreon' >

<h1 className='font-kenia text-4xl'>Neemat.Design</h1>

<div className='hidden sm:ml-6 sm:block'>
  {navLinks.map((nav,index) => (
    <div className="flex space-x-4" >
      <a href={nav.href}
       className={classNames(
        nav.current ? 'bg-red text-white' : 'text-gray-300 hover:bg-blue hover:text-white',
        'rounded-md px-4 py-2 text-md font-medium '
      )}
      aria-current={nav.current ? 'page' : undefined}
       >{nav.title}</a>
    </div>
  ))}
</div>
      </nav>
  )
}

export default Navbar;
